class Solution {
    public void setZeroes(int[][] matrix) {
        HashSet<Integer> row = new HashSet<>();
        HashSet<Integer> col = new HashSet<>();
        for(int i=0;i<matrix.length;i++){
            for(int j=0;j<matrix[0].length;j++){
                if(matrix[i][j]==0){
                    row.add(i);
                    col.add(j);
                }
            }
        }
        for(int i=0;i<matrix.length;i++){
            for(int j=0;j<matrix[0].length;j++){
                if(row.contains(i)) matrix[i][j] = 0;
                if(col.contains(j)) matrix[i][j] = 0;
            }
        }
    }
}

class Solution {
    public int trap(int[] height) {
        int max=0;int n=height.length;
        int left=0;int right=n-1;
        int leftmax=height[0];int rightmax=height[n-1];
        while(left<right){ 
            leftmax=Math.max(leftmax,height[left]);
            rightmax=Math.max(rightmax,height[right]);
            if(leftmax<rightmax){
                max+=(leftmax-height[left++]);
            }
            else
                max+=(rightmax-height[right--]);

        }
        return max;
}}

class Solution {
    public int trap(int[] height) {
        int maxwater =0, n = height.length;
        int l=0, r=n-1, lm = height[0], rm = height[n-1];
        while(l<r){
            lm = Math.max(lm, height[l]);
            rm = Math.max(rm, height[r]);
            if(lm < rm){
                maxwater += lm - height[l++];
            }
            else{
                maxwater += rm - height[r--];
            }
        }
        return maxwater;
    }
}

class Solution {
    public void setZeroes(int[][] matrix) {
        int rowFlag=0;
        int colFlag=0;
        for(int i=0;i<matrix.length;i++){
            if(matrix[i][0]==0){
                colFlag=1;
                break;
            }
        }
        for(int i=0;i<matrix[0].length;i++){
            if(matrix[0][i]==0){
                rowFlag=1;
                break;
            }
        }
        for(int i=1;i<matrix.length;i++){
            for(int j=1;j<matrix[0].length;j++){
                if(matrix[i][j]==0){
                    matrix[i][0]=0;
                    matrix[0][j]=0;
                }
            }
        }
        for(int i=1;i<matrix.length;i++){
            for(int j=1;j<matrix[0].length;j++){
                if(matrix[i][0]==0 || matrix[0][j]==0){
                    matrix[i][j]=0;
                }
            }
        }
        if(rowFlag==1){
            for(int i=0;i<matrix[0].length;i++){
                matrix[0][i]=0;
            }
        }
        if(colFlag==1){
            for(int i=0;i<matrix.length;i++){
                matrix[i][0]=0;
            }
        }
    }
}

class Solution {
    public void setZeroes(int[][] matrix) {
        boolean zeroinFirstCol = false;
        for (int row = 0; row < matrix.length; row++) {
            if (matrix[row][0] == 0) zeroinFirstCol = true;
            for (int col = 1; col < matrix[0].length; col++) {
                if (matrix[row][col] == 0) {
                    matrix[row][0] = 0;
                    matrix[0][col] = 0;
                }
            }
        }

        for (int row = matrix.length - 1; row >= 0; row--) {
            for (int col = matrix[0].length - 1; col >= 1; col--) {
                if (matrix[row][0] == 0 || matrix[0][col] == 0) {
                    matrix[row][col] = 0;
                }
            }
            if (zeroinFirstCol) {
                matrix[row][0] = 0;
            }
        }
    }
}

class Solution {
    public void setZeroes(int[][] matrix) {
        int R = matrix.length,C=matrix[0].length;
        boolean firstR=false,firstC=false;
        for(int r=0;r<R;++r){
            for(int c=0;c<C;++c){
                if(matrix[r][c]==0){
                    if(r!=0)
                        matrix[r][0]=0;
                    else
                        firstR=true;
                    if(c!=0)
                        matrix[0][c]=0;
                    else
                        firstC=true;
                }
            }
        }
        for(int r=1;r<R;++r){
            for(int c=1;c<C;++c){
                if(matrix[r][0]==0 ||  matrix[0][c]==0){
                    matrix[r][c]=0;
                }
            }
        }
        if(firstC)
            for(int r=0;r<R;++r)
                matrix[r][0]=0;
        if(firstR)
            for(int c=0;c<C;++c)
                matrix[0][c]=0;
    }
}

