class Solution {
    public int trap(int[] height) {
        int left=0;
        while(left<height.length && height[left]==0){
            left++;
        }
        int right=height.length-1;
        while(right>-1 && height[right]==0){
            right--;
        }
        int ptr=0;
        int ptr2=0;
        int sum=0;
        int direction=0;
        while(left<right){
            if(height[left]<=height[right]){
                ptr=left;
                ptr2=left;
                direction=0;
                boolean flag=true;
                while(ptr2<=right && (height[ptr2]<height[left] || flag)){
                    ptr2++;
                    flag=false;
                }
                // System.out.println("DIRECTION: 0 left: "+left+" ptr: "+ptr+" ptr2: "+ptr2);
            }
            else{
                ptr=right;
                ptr2=right;
                direction=1;
                boolean flag=true;
                while(ptr2>=left && (height[ptr2]<height[right] || flag)){
                    ptr2--;
                    flag=false;
                }
                // System.out.println("DIRECTION: 1 right: "+right+" ptr: "+ptr+" ptr2: "+ptr2);
            }
            if(direction==0){
                while(ptr<ptr2){
                    sum+=Math.min(height[left],height[ptr2])-height[ptr];
                    ptr++;
                }
                left=ptr2;
            }
            else{
                while(ptr>ptr2){
                    sum+=Math.min(height[right],height[ptr2])-height[ptr];
                    ptr--;
                }
                right=ptr2;
            }
            // System.out.println("sum :"+sum);

        }
        return sum;
    }
}

