        """
        Do not return anything, modify matrix in-place instead.
        """
        def row(arr, rows):
            for j in range(len(arr[0])):
                if arr[rows][j] != 0:
                    arr[rows][j] = -111

        def col(arr, cols):
            for i in range(len(arr)):
                if arr[i][cols] != 0:
                    arr[i][cols] = -111

        for i in range(len(matrix)):
            for j in range(len(matrix[0])):
                if matrix[i][j] == 0:
                    row(matrix, i)
                    col(matrix, j)

        for i in range(len(matrix)):
            for j in range(len(matrix[0])):
                if matrix[i][j] == -111:
                    matrix[i][j] = 0

