/**
 * Definition for a binary tree node.
 * public class TreeNode {
 *     int val;
 *     TreeNode left;
 *     TreeNode right;
 *     TreeNode() {}
 *     TreeNode(int val) { this.val = val; }
 *     TreeNode(int val, TreeNode left, TreeNode right) {
 *         this.val = val;
 *         this.left = left;
 *         this.right = right;
 *     }
 * }
 */
class Solution {
    private static int lev;
    private static int max;
    public int findBottomLeftValue(TreeNode root) {
        lev=0;
        max=root.val;
        dfs(root,0);
        return max;
    }
    private static void dfs(TreeNode root,int l){
        if(root.left!=null){
            if(lev<l+1){
                lev=l+1;
                max=root.left.val;
            }
            dfs(root.left,l+1);
        }
        if(root.right!=null){
            if(lev<l+1){
                lev=l+1;
                max=root.right.val;
            }
            dfs(root.right,l+1);
        }
    }
}

class Solution {
public:
    int maxDepth=-1;
    int ans=0;

    void dfs(TreeNode* root, int depth) {
        if(!root) return;

        if(depth>maxDepth) {
            maxDepth=depth;
            ans=root->val;
        }

        dfs(root->left,depth+1);
        dfs(root->right,depth+1);
    }

    int findBottomLeftValue(TreeNode* root) {
        dfs(root,0);
        return ans;
    }
};

