/**
 * Definition for a binary tree node.
 * public class TreeNode {
 *     int val;
 *     TreeNode left;
 *     TreeNode right;
 *     TreeNode() {}
 *     TreeNode(int val) { this.val = val; }
 *     TreeNode(int val, TreeNode left, TreeNode right) {
 *         this.val = val;
 *         this.left = left;
 *         this.right = right;
 *     }
 * }
 */
class Solution {
    public int findBottomLeftValue(TreeNode root) {
        int res=0;
        Queue<TreeNode> qu=new LinkedList<>();
        qu.add(root);
        while(!qu.isEmpty()){
            int siz=qu.size();
            boolean vst=false;
            int val=0;
            for(int i=0;i<siz;i++){
                TreeNode cur=qu.poll();
                if(!vst){
                    val=cur.val;
                    vst=true;
                }
                if(cur.left!=null) qu.add(cur.left);
                if(cur.right!=null) qu.add(cur.right);
            }
            res=val;
        }
        return res;
    }
}

# Definition for a binary tree node.
# class TreeNode:
#     def __init__(self, val=0, left=None, right=None):
#         self.val = val
#         self.left = left
#         self.right = right
class Solution:
    def findBottomLeftValue(self, root: Optional[TreeNode]) -> int:
        mp={}
        queue=collections.deque()
        queue.append((root,0))
        while queue:
            node,idx=queue.popleft()
            if idx not in mp:
                mp[idx]=node.val
            if node.left:
                queue.append((node.left,idx+1))
            if node.right:
                queue.append((node.right,idx+1))
        lastkey=list(mp.keys())[-1]
        return mp[lastkey]
