 * Definition for a binary tree node.
 * public class TreeNode {
 *     int val;
 *     TreeNode left;
 *     TreeNode right;
 *     TreeNode() {}
 *     TreeNode(int val) { this.val = val; }
 *     TreeNode(int val, TreeNode left, TreeNode right) {
 *         this.val = val;
 *         this.left = left;
 *         this.right = right;
 *     }
 * }
 */
class Solution {
    public int findBottomLeftValue(TreeNode root) {
        int res=0;
        Queue<TreeNode> qu=new LinkedList<>();
        qu.add(root);
        while(!qu.isEmpty()){
            int siz=qu.size();
            boolean vst=false;
            int val=0;
            for(int i=0;i<siz;i++){
                TreeNode cur=qu.poll();
                if(!vst){
                    val=cur.val;
                    vst=true;
                }
                if(cur.left!=null) qu.add(cur.left);
                if(cur.right!=null) qu.add(cur.right);
            }
            res=val;
        }
        return res;
    }
}

class Solution {
    public void setZeroes(int[][] mat) {
        int m=mat.length,n=mat[0].length;
        int column0=1;
        for(int i=0;i<m;i++){
            for(int j=0;j<n;j++){
                if(mat[i][j]==0){
                    mat[i][0]=0;
                    if(j==0) column0=0;
                    else mat[0][j]=0;
                }
            }
        }
        for(int i=1;i<m;i++){
            for(int j=1;j<n;j++){
                if(mat[i][0]==0 || mat[0][j]==0){
                    mat[i][j]=0;
                }
            }
        }
        if(mat[0][0]==0){
            for(int j=0;j<n;j++){
                mat[0][j]=0;
            }
        }
        if(column0==0){
            for(int i=0;i<m;i++){
                mat[i][0]=0;
            }
        }
    }
}

